//Question Node Screen Question node activity ಮಾರ್ಪಡಿಸಿ ನೀವು ಎಲ್ಲಾ ಪ್ರಶ್ನೆಗಳಿಗೆ ಉತ್ತರಿಸಿದ್ದೀರಿ ಎಂದು ನಿಮಗೆ ಖಚಿತವಾಗಿದೆಯೇ? ದಯವಿಟ್ಟು ಎಲ್ಲಾ ಸಾಮಾನ್ಯ ಪರೀಕ್ಷೆಯ ಪ್ರಶ್ನೆಗಳಿಗೆ ಉತ್ತರಿಸಿ. ದಯವಿಟ್ಟು ಅವಧಿಯನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ವಿಷಯವನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ದಿನಾಂಕವನ್ನು ಆರಿಸಿ ದಯವಿಟ್ಟು ಸ್ಥಳಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ ದಯವಿಟ್ಟು ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ಪ್ರದೇಶವನ್ನು ನಮೂದಿಸಿ (ಅಗಲ X ಉದ್ದ) ದಯವಿಟ್ಟು ಶ್ರೇಣಿಯನ್ನು ನಮೂದಿಸಿ ದಯವಿಟ್ಟು ಎಷ್ಟು ಬಾರಿ ನಮೂದಿಸಿ
//Table Exam Screen ಅತ್ಯಗತ್ಯವಾದ ದೈಹಿಕ ವಿವರಗಳು ದೇಹದ ಅಳತೆಗಳು ಎತ್ತರ (ಸೆಂ) ತೂಕ (ಕೆಜಿ) ಬಿಎಂಐ ನಾಡಿ (ಬಿಪಿಎಂ) ಪ್ರಮುಖ ಚಿಹ್ನೆಗಳು ಬಿಪಿ. (ಸಿಸ್ಟೋಲಿಕ್) ಬಿಪಿ (ಡಯಾಸ್‌ಟೋಲಿಕ್ ) ತಾಪಮಾನ (ಸಿ) SpO2 (%)
