ಡೇಟಾಬೇಸ್ ಬ್ಯಾಕಪ್ ಪೂರ್ಣಗೊಂಡಿದೆ "ಡೇಟಾಬೇಸ್ ಮರುಸ್ಥಾಪನೆ ಪೂರ್ಣಗೊಂಡಿದೆ "
ಡೇಟಾಬೇಸ್ ಅನ್ನು ಕ್ಲೌಡ್‌ಗೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕ ಲಭ್ಯವಿಲ್ಲ ಬ್ಯಾಕಪ್ ಮಾಡಲು ಡೇಟಾ ಇಲ್ಲ! ಸ್ಥಳೀಯ ಬ್ಯಾಕಪ್ ಲಭ್ಯವಿಲ್ಲ "ಸ್ಥಳೀಯ ಬ್ಯಾಕಪ್‌ನಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗುತ್ತಿದೆ "
ಫಾರ್ಮ್ ಮೋಡವನ್ನು ಮರುಸ್ಥಾಪಿಸಿ ಡೇಟಾವನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗುತ್ತಿದೆ ಡೇಟಾಬೇಸ್ ಡೇಟಾವನ್ನು ಹೊಂದಿದೆ, ಮರುಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ! ಮೋಡದಿಂದ ಡೇಟಾಬೇಸ್ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಮೋಡದಿಂದ ಡೇಟಾವನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗುತ್ತಿದೆ (ಬಲವಂತವಾಗಿ) ಡೇಟಾಬೇಸ್ ಅಪ್‌ಲೋಡ್ ಡೇಟಾಬೇಸ್ ಅಪ್‌ಲೋಡ್ ಡೇಟಾಬೇಸ್ ಅಪ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ ಡೇಟಾಬೇಸ್ ಅಪ್‌ಲೋಡ್ ವಿಫಲವಾಗಿದೆ ಡೇಟಾಬೇಸ್ ಬ್ಯಾಕಪ್ ಲಭ್ಯವಿಲ್ಲ ಬ್ಯಾಕಪ್ ಫೈಲ್‌‌ ಬರೆಯುವಲ್ಲಿ ದೋಷ ಬ್ಯಾಕಪ್ ಮರುಸ್ಥಾಪಿಸಿ ಸ್ಥಳೀಯ ಬ್ಯಾಕಪ್ ಕಂಡುಬಂದಿದೆ. ನೀವು ರೀಸೆಟ್‌ ಮಾಡಲು ಬಯಸುವಿರಾ?
ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಚಿತ್ರದ ದತ್ತಾಂಶವನ್ನು ವನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಚಿತ್ರದ ದತ್ತಾಂಶದ ಡೌನ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ ಎಲ್ಲಾ ಇಮೇಜ್ ಫೈಲ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಚಿತ್ರ ಲಭ್ಯವಿಲ್ಲ ಚಿತ್ರ ಡೌನ್‌ಲೋಡ್ ವಿಫಲವಾಗಿದೆ
ಈಗಾಗಲೇ ಲಾಗ್ ಇನ್ ಆಗಿದೆ! ಈಗಾಗಲೇ ಲಾಗ್ ಇನ್ ಮಾಡಲಾಗಿದೆ. ಇತರ ಸಾಧನದಿಂದ ಲಾಗ್ ಔಟ್ ಮಾಡಿ. ಸರ್ವರ್‌ನಿಂದ ಲಾಗ್ ಔಟ್ ಆಗಿದೆ ಲಾಗಿನ್ ಯಶಸ್ವಿಯಾಗಿದೆ! "ಇನ್ನೊಬ್ಬ ಬಳಕೆದಾರರು ಈ ಸ್ಥಳಕ್ಕೆ ಲಾಗ್ ಇನ್ ಆಗಿದ್ದಾರೆ. ದಯವಿಟ್ಟು ನಿರ್ವಾಹಕ ಸಾಧನ(admin device)ವನ್ನು ಆಫ್‌ಲೈನ್‌ನಲ್ಲಿ ಸಂಪರ್ಕಿಸಿ. " ಲಾಗಿನ್ ಪರಿಶೀಲನೆಗಾಗಿ ಸರ್ವರ್ ಅನ್ನು ಪರಿಶೀಲಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ
ಸ್ಪ್ಲಾಷ್ ಆಕ್ಟಿವಿಟಿ ಹೋಮ್ ಆಕ್ಟಿವಿಟಿ ಚಟುವಟಿಕೆ ರಿಫ್ರೆಶ್ ಗೌಪ್ಯತೆ ಸೂಚನೆ ಭೇಟಿಯ ಸಾರಾಂಶ ಚಟುವಟಿಕೆ ಹಿಂದಿನ ವೈದ್‌ಯಕೀಯ ವಿವರದ ಚಟುವಟಿಕೆ ರೋಗಿಯ ಸರ್ವೆ ಆಕ್ಟಿವಿಟಿ
ದಯವಿಟ್ಟು ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿ ತಾಪಮಾನ (ಎಫ್) ಈಗ ರಿಫ್ರೆಶ್ ಮಾಡಿ ಲಾಸ್ಟ ಸಿಂಕ್ ನಿಮ್ಮ ಪಾಸ್‌ವರ್ಡ್ ನಮೂದಿಸಿ ನಿಮ್ಮ ಬಳಕೆದಾರ ಹೆಸರು ನಮೂದಿಸಿ ರೋಗಿಯು ನಿರಾಕರಿಸುತ್ತಾನೆ "ರೋಗಿಯು ವರದಿ ನಾಡಿಕೊಳ್ಳುತ್ತಾನೆ "
ಸಂಬಂದಿಸಿದ ಲಕ್ಷಣಗಳು ಸರ್ವರ್ ಯು.ಆರ್.ಎಲ್. ಅನ್ನು ನಮೂದಿಸಿ ಪರವಾನಗಿ ಕೀಲಿಯನ್ನು ನಮೂದಿಸಿ ಅಮಾನ್ಯ ಯು.ಆರ್.ಎಲ್. ವರ್ಷಗಳು ತಿಂಗಳುಗಳು ರಿಫ್ರೆಶ್ ಪೂರ್ಣಗೊಳ್ಳುವವರೆಗೆ ದಯವಿಟ್ಟು ಕಾಯಿರಿ ರೋಗಿಯ ಹೆಸರು ಮಗ / ಮಗಳು / ಹೆಂಡತಿ ಉದ್ಯೋಗ ಆರ್ಥಿಕ ಸ್ಥಿತಿ ಶಿಕ್ಷಣ ಮಟ್ಟ ಜಾತಿ ಹಿಂದಿನ ಭೇಟಿಗಳು ಒಪ್ಪಿಕೊಳ್ಳಿ ತಿರಸ್ಕರಿಸಿ ಮುಂದೆ ನೀವು ಯಾವ ಸರ್ವರ್‌ಗೆ ಸಂಪರ್ಕಿಸಲು ಬಯಸುತ್ತೀರಿ? ಯು.ಆರ್.ಎಲ್. ಅನ್ನು ನಮೂದಿಸಿ ಲಾಗಿನ್ ಮಾಡಲು ಸ್ಥಳವನ್ನು ಆರಿಸಿ ಪ್ರಟೋಕಾಲ್‌ಗಳಿಗಾಗಿ ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿ ದಯವಿಟ್ಟು ನಿಮ್ಮ ಬಳಕೆದಾರಹೆಸರು ಮತ್ತು ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ನಮೂದಿಸಿ ಆಂಡ್ರಾಯ್ಡ್ ಐಡಿ: ಉಸಿರಾಟದ ಗತಿ ಚಿತ್ರಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲು ಕ್ಲಿಕ್ ಮಾಡಿ ವೈದ್ಯರ ವಿವರಗಳು ಆರೋಗ್ಯ ಕಾರ್ಯಕರ್ತ "ಆದ್ಯತೆ " ಸರ್ವರ್ ಯು.ಆರ್.ಎಲ್. ರಿಫ್ರೆಶ್ ಮಾಡಿ ಪ್ರಟೋಕಾಲ್‌ಗಳನ್ನು ನವೀಕರಿಸಿ ಎಲ್ಲಾ ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಿ ನಿರ್ಮಾತೃಗಳಿಂದ ಶೋಧಿಸಿ ಗ್ರಹದ ಹೆಸರು "ಸರಿ " ರದ್ದುಮಾಡಿ ಕೊನೆಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಭೇಟಿಗಳು. ಕೊನೆಗೊಳಿಸಲು ಪ್ರಯತ್ನಿಸುವ ಮೊದಲು ದಯವಿಟ್ಟು ಭೇಟಿಯನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಿ ಸಕ್ರಿಯ ಮುಚ್ಚಲಾಗಿದೆ
ರಿಫ್ರೆಶ್ ಪ್ರಗತಿಯಲ್ಲಿದೆ ದಯಮಾಡಿ ನಿರೀಕ್ಷಿಸಿ... ರಿಫ್ರೆಶ್ ಮಾಡಿ ರಿಫ್ರೆಶ್ ಬ್ಯಾಕ್‌ಗ್ರೌಂಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ ರಿಫ್ರೆಶ್ ಲಭ್ಯವಿಲ್ಲ ದಯವಿಟ್ಟು ಇಂಟರ್ನೆಟ್ ನ ಸಂಪರ್ಕವನ್ನು ಹೊಂದಿರಿ ಇಮೇಜ್ ಅಪ್‌ಲೋಡ್ ಇಮೇಜ್ ಅಪ್ಲೋಡ್ ವಿಫಲವಾಗಿದೆ ನೀನು ನಿಜವಾಗಲೂ ಹೊರಗೆ ಹೂಗಬಯಸುತ್ತೀಯಾ? ನೀವು ಲಾಗ್ ಔಟ್ ಮಾಡಲು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ? ಕೊನೆಯ ರಿಫ್ರೆಶ್ ರೋಗಿಯನ್ನು ನವೀಕರಿಸಿ ನೀವು ಖಚಿತವಾಗಿ ಹಿಂದೆ ಹೋಗಲು ಬಯಸುವಿರಾ? ದೋಷ ರೋಗಿಯ ಡೇಟಾ ಅಪ್‌ಲೋಡ್ ರೋಗಿಯ ಚಿತ್ರ ಡೌನ್‌ಲೋಡ್ ಇಮೇಜ್ ಡೌನ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ. ಯಾವುದೇ ಪೂರ್ವ ಭೇಟಿಗಳಿಲ್ಲ. ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಿ ಭೇಟಿ ಕೊನೆಗೊಂಡಿದೆ ಈ ಪ್ರಶ್ನೆಗೆ ಒಂದೇ ಉತ್ತರವಿದೆ. ವೈದ್ಯರಿಗೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ. ಡೇಟಾ ಅಪ್‌ಲೋಡ್‌ಗೆ ಭೇಟಿ ನೀಡಿ ಭೇಟಿಯ ವಿವರಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಭೇಟಿಯ ವಿವರಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ವಿಫಲವಾಗಿದೆ ಅಪ್‌ಲೋಡ್ ಪೂರ್ಣಗೊಂಡಿದೆ ನಿಮ್ಮ ಅಂತರ್ಜಾಲ ಸಂಪರ್ಕವನ್ನು ಪರಿಶೀಲಿಸಿ ವೈದ್ಯರಿಂದ ಡೌನ್‌ಲೋಡ್ ಮಾಡಿ " ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ" ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಭೇಟಿಯ ಡೇಟಾ ವಿಫಲವಾಗಿದೆ ರೋಗಿಯ ಡೇಟಾ ವಿಫಲವಾಗಿದೆ ಗೌಪ್ಯತೆ ಸೂಚನೆ ಈ ಆರೋಗ್ಯ ಕಾರ್ಯಕರ್ತರಿಗೆ ಯಾವುದೇ ರೋಗಿಗಳ ದಾಖಲೆಗಳು ಕಂಡುಬಂದಿಲ್ಲ. ರಿಫ್ರೆಶ್ ಮಡಲಾಗುತ್ತಿದೆ ರಿಫ್ರೆಶ್ ಯಶಸ್ವಿಯಾಗಿದೆ ಭಾಷೆಗಳು ಪ್ರಸ್ತುತ ಉಪಯೋಗಿಸುತ್ತಿರುವ ಭಾಷೆ ಪ್ರಟೋಕಾಲ್ಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ! ಯಾವುದೇ ಪ್ರೋಟೋಕಾಲ್ಗಳು ಕಂಡುಬಂದಿಲ್ಲ ಪ್ರೋಟೋಕಾಲ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡುವಲ್ಲಿ ಸಮಸ್ಯೆ ಇದೆ, ದಯವಿಟ್ಟು ಸಿಸ್ಟಮ್ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ ಕೊನೆಯ ರಿಫ್ರೆಶ್ - ಇಂದು ಭೇಟಿ ಸಕ್ರಿಯ ಭೇಟಿಗಳು ದಿನ ಗಂಟೆ ನಿಮಿಷ ಹಿಂದೆ ಯಶಸ್ವಿಯಾಗಿ ರಿಫ್ರೆಶ್ ಆಗಿದೆ ಭೇಟಿಯ ವಿವರಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಿಲ್ಲ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ ಭೇಟಿಯ ವಿವರಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ ಇಂಟರ್ನೆಟ್ ಇದ್ದಾಗ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗುತ್ತದೆ "ID ಗೆ ಭೇಟಿ ನೀಡಿ "
ಭೇಟಿಯನ್ನು ಕೊನೆಗೊಳಿಸಲು ನೀವು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ? ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಡೌನ್‌ಲೋಡ್ ಆಗಿಲ್ಲ, ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕವನ್ನು ಪರಿಶೀಲಿಸಿ ಒಪ್ಪಿಗೆಯಿಲ್ಲದೆ ರೋಗಿಯನ್ನು ನೋಂದಾಯಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಉತ್ತರಿಸಲಾಗಿಲ್ಲ ಹೊಸ ನವೀಕರಣ ಲಭ್ಯವಿದೆ ಹೊಸ ವೈಶಿಷ್ಟ್ಯಗಳೊಂದಿಗೆ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ ದಯವಿಟ್ಟು ಅಪ್ಲಿಕೇಶನ್ ನವೀಕರಿಸಿ ನವೀಕರಿಸಿ
ನಿಮ್ಮ ಭೇಟಿಗೆ ಕಾರಣವೇನು? ಮುಂದೆ ಹೋಗಲು ಮೇಲಕ್ಕೆ ಮತ್ತು ಹಿಂದೆ ಹೋಗಲು ಕೆಳಗೆ ಸ್ವೈಪ್ ಮಾಡಿ ಮುಂದಿನದಕ್ಕೆ ಮೇಲಕ್ಕೆ ಸ್ವೈಪ್ ಮಾಡಿ ಹಿಂದಿನದಕ್ಕೆ ಕೆಳಗೆ ಸ್ವೈಪ್ ಮಾಡಿ ನಿಮಗೆ ಈ ರೋಗಲಕ್ಷಣವಿದೆಯೇ?
